import React from 'react';
import './styles.css'

function profile() {
    const image = '../../assets/avatar.png'
  return (
    <div className='profile-cont'>
        <div className='profile-img-cont'>
            <div className='circle'>
                <img src={image} alt='No Image'/>
            </div>
        </div>
    </div>
    );
}

export default profile;
